import { Route, Routes, Link } from 'react-router-dom';
import './App.css';

// Define another component for the home route
function Home() {
  return <h1>Welcome to the Home Page!</h1>;
}

function App() {
  return (
    <div className="App">
      <nav>
        <Link to="/">Home</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Home />} /> {/* Use a different component for the route */}
      </Routes>
    </div>
  );
}

export default App;
